import './App.css';
import React, { useState } from "react";
import { Unity, useUnityContext } from "react-unity-webgl";

function App() {
  const [showUnity, setShowUnity] = useState(false);

  const { unityProvider } = useUnityContext({
    loaderUrl: "Build/MergePuzzle.loader.js",
    dataUrl: "Build/MergePuzzle.data",
    frameworkUrl: "Build/MergePuzzle.framework.js",
    codeUrl: "Build/MergePuzzle.wasm",
  });

  return (
    <div className="App" style={{ background: "#222", minHeight: "100vh" }}>
      <header className="App-header" style={{ padding: "2rem 0", background: "#282c34", minHeight: "100vh" }}>
        <h1 style={{
          marginBottom: "2.5rem",
          letterSpacing: "0.12em",
          fontWeight: 700,
          fontSize: "2.4rem",
          color: "#fff"
        }}>ポートフォリオ</h1>
        <div
          style={{
            display: "flex",
            gap: "2.5rem",
            alignItems: "flex-start",
            width: "100%",
            maxWidth: 1200,
            margin: "0 auto",
            justifyContent: "center"
          }}
        >
          {/* プロフィール */}
          <section
            style={{
              flex: "0 0 350px",
              background: "#fff",
              color: "#222",
              borderRadius: "16px",
              padding: "2.2rem 2rem 1.8rem 2rem",
              boxShadow: "0 6px 32px rgba(0,0,0,0.13)",
              textAlign: "left",
              minWidth: 300,
              maxWidth: 400,
              border: "1.5px solid #e0e0e0"
            }}
          >
            <h2 style={{
              borderBottom: "2px solid #4caf50",
              paddingBottom: "0.7rem",
              marginBottom: "1.5rem",
              fontSize: "1.35rem",
              fontWeight: 700,
              letterSpacing: "0.04em"
            }}>プロフィール</h2>
            <div style={{ lineHeight: 2.1, fontSize: "1.08em" }}>
              <div><strong>名前：</strong>林田 歴</div>
              <div><strong>年齢：</strong>23歳</div>
              <div><strong>学歴：</strong>福岡大学大学院工学研究科電子情報工学専攻博士課程前期<br />2025年4月~2027年3月卒業見込み</div>
              <div><strong>趣味：</strong>ゲーム、アニメ、プログラミング</div>
              <div><strong>使用経験のある言語：</strong>C, C#, Python, Java, JavaScript, HTML, CSS</div>
              <div><strong>使用経験のあるツール：</strong>Unity</div>
              <div><strong>使用経験のあるフレームワーク：</strong>React</div>
            </div>
          </section>
          {/* 成果物 */}
          <section
            style={{
              flex: 1,
              background: "#23272f",
              color: "#fff",
              borderRadius: "16px",
              padding: "2.2rem 2rem",
              boxShadow: "0 6px 32px rgba(0,0,0,0.10)",
              minWidth: 350,
              textAlign: "center",
              border: "1.5px solid #333"
            }}
          >
            <h2 style={{
              borderBottom: "2px solid #4caf50",
              paddingBottom: "0.7rem",
              marginBottom: "1.5rem",
              fontSize: "1.35rem",
              fontWeight: 700,
              letterSpacing: "0.04em"
            }}>作成したゲーム</h2>
            {!showUnity && (
              <button
                onClick={() => setShowUnity(true)}
                style={{
                  padding: "1.1em 2.8em",
                  fontSize: "1.18em",
                  borderRadius: "12px",
                  border: "none",
                  background: "linear-gradient(90deg, #4caf50 60%, #388e3c 100%)",
                  color: "#fff",
                  cursor: "pointer",
                  marginBottom: "2.2rem",
                  fontWeight: "bold",
                  boxShadow: "0 2px 12px rgba(76,175,80,0.18)",
                  transition: "background 0.2s"
                }}
              >
                Unityゲームを表示
              </button>
            )}
            {showUnity && (
              <div style={{ marginTop: "1.5rem", position: "relative", display: "inline-block" }}>
                <button
                  onClick={() => setShowUnity(false)}
                  style={{
                    position: "absolute",
                    top: "-48px",
                    right: "0",
                    padding: "0.7em 1.4em",
                    fontSize: "1.05em",
                    borderRadius: "10px",
                    border: "none",
                    background: "#f44336",
                    color: "#fff",
                    cursor: "pointer",
                    zIndex: 2,
                    fontWeight: "bold",
                    boxShadow: "0 2px 10px rgba(244,67,54,0.15)",
                    transition: "background 0.2s"
                  }}
                >
                  閉じる
                </button>
                <Unity
                  unityProvider={unityProvider}
                  style={{
                    width: 800,
                    height: 600,
                    border: "2px solid #222",
                    background: "#222",
                    borderRadius: "12px"
                  }}
                />
              </div>
            )}
          </section>
        </div>
      </header>
    </div>
  );
}

export default App;
